def priority(item: float, bins: np.ndarray) -> np.ndarray:
    """Returns priority with which we want to add item to each bin.

    Args:
        item: Size of item to be added to the bin.
        bins: Array of capacities for each bin.

    Return:
        Array of same size as bins with priority score of each bin.
    """
    priorities = np.zeros(len(bins))

    for i, bin_capacity in enumerate(bins):
        if item == bin_capacity:
            priorities[i] = 1.0
        elif item < bin_capacity:
            priorities[i] = item / bin_capacity
        else:
            remaining_capacity = bin_capacity
            used_capacity = sum(bins[:i])
            remaining_capacity -= used_capacity
            if item <= remaining_capacity:
                priorities[i] = 1.0
            else:
                excess_capacity = item - remaining_capacity
                capacity_left = bins[i] - remaining_capacity

                if excess_capacity < capacity_left * 0.1:
                    priorities[i] = 0.9
                elif excess_capacity < capacity_left * 0.2:
                    priorities[i] = 0.8
                elif excess_capacity < capacity_left * 0.3:
                    priorities[i] = 0.7
                elif excess_capacity < capacity_left * 0.4:
                    priorities[i] = 0.6
                elif excess_capacity < capacity_left * 0.5:
                    priorities[i] = 0.5
                elif excess_capacity < capacity_left * 0.6:
                    priorities[i] = 0.4
                elif excess_capacity < capacity_left * 0.7:
                    priorities[i] = 0.3
                elif excess_capacity < capacity_left * 0.8:
                    priorities[i] = 0.2
                else:
                    priorities[i] = 0.1

    return priorities
